import React from "react";
import ExpenseItem from "./components/ExpenseItem";
const App = () => {
  const expense = [
    {
      id: 1,
      title: "Buy Car",
      amount: 212.0,
      date: new Date(2021, 20, 10),
    },
    {
      id: 2,
      title: "Car Asurance",
      amount: 200.0,
      date: new Date(2021, 10, 10),
    },
    {
      id: 3,
      title: "Eat",
      amount: 10.0,
      date: new Date(2021, 9, 10),
    },
  ];
  return (
    <div>
      <h1>Lets Get Started</h1>
      <ExpenseItem item={expense} />
    </div>
  );
};

export default App;
